import Exercise from './Exercise';

export default function ExerciseList({ exercises }) {
    return (
        <>
            {exercises?.map(exercise => {
                <Exercise 
                    key={exercise.id}
                    name={exercise.name}
                    bodypart={exercise.bodypart}
                    description={exercise.description}
                />
            })}
        </>
    );
}
